Yep, I'd like to see something like:

```
ThemeDate {
  /// Defines the ... for ...
  Brightness brightness,
}
```

and once you type `brightness: ...`, you'd see the docs for the parameter.

Actually, I think this is a bug. The parameters often (if not always) have docs, IntelliJ just don't show them (perhaps as they are on the member the param is setting?).

For example, try to set the `style:` parameters on a `Text` widget. IntelliJ shows no documentation, but it's [right there](https://github.com/flutter/flutter/blob/master/packages/flutter/lib/src/widgets/text.dart#L75):

```
  Text(this.data, {
    Key key,
    this.style,
    this.textAlign,
    this.softWrap,
    this.overflow,
    this.textScaleFactor,
    this.maxLines,
  }) : super(key: key) {
    assert(data != null);
  }

  /// The text to display.
  final String data;

  /// If non-null, the style to use for this text.
  ///
  /// If the style's "inherit" property is true, the style will be merged with
  /// the closest enclosing [DefaultTextStyle]. Otherwise, the style will
  /// replace the closest enclosing [DefaultTextStyle].
  final TextStyle style;
```

[This CL](https://codereview.chromium.org/2681233005) make it possible for Dart plugin to get documentation for field formal parameters in hover, and, in theory, in completion.

The `analysis.getHover` request works.
![image](https://cloud.githubusercontent.com/assets/384794/22809598/6313649c-eee8-11e6-9c6a-4c6806237b50.png)


But during completion we don't get documentation because by some reason IDEA does not use the specified element's location.

```Dart
class A {
  /**
   * aaaaaaaa
   * bbbbbbbb
   */
  final int fffff;

  A(int aaa, {this.fffff});
}

main(A a) {
  new A(1, )
}
```


![image](https://cloud.githubusercontent.com/assets/384794/22809502/e58c7658-eee7-11e6-966b-86c68e126493.png)
```JSON
{
  "event": "completion.results",
  "params": {
    "id": "40",
    "replacementOffset": 124,
    "replacementLength": 0,
    "results": [
      {
        "kind": "NAMED_ARGUMENT",
        "relevance": 1060,
        "completion": "fffff: ",
        "selectionOffset": 7,
        "selectionLength": 0,
        "isDeprecated": false,
        "isPotential": false,
        "docSummary": "aaaaaaaa\nbbbbbbbb",
        "docComplete": "aaaaaaaa\nbbbbbbbb",
        "element": {
          "kind": "PARAMETER",
          "name": "fffff",
          "location": {
            "file": "/Users/scheglov/dart/test/bin/test.dart",
            "offset": 89,
            "length": 5,
            "startLine": 8,
            "startColumn": 20
          },
          "flags": 0,
          "returnType": "int"
        },
        "parameterName": "fffff",
        "parameterType": "int"
      }
    ],
    "isLast": true
  }
}
```

```JSON
{
  "id": "1043",
  "method": "analysis.getHover",
  "params": {
    "file": "/Users/scheglov/dart/test/bin/test.dart",
    "offset": 115
  },
  "clientRequestTime": 1486687776493
}
```

Note that `115` is the offset of `new A(1, )`, not of the parameter `fffff` at `89`.

@alexander-doroshko, Konstantin did some work to improve the docs we return for named params. It looks like he hit an issue w/ IntelliJ:

> But during completion we don't get documentation because by some reason IDEA does not use the specified element's location.

Does his analysis makes sense? If so, I can open a tracking issue at youtrack w/ the above details. Thanks!
